import { useRouter } from "next/router";
import { connect } from "react-redux";

import retrievePostActions from "store/retrievePost/actions";
import { IRetrievePost } from "interfaces";

const Posts: React.FC<{ post: IRetrievePost }> = ({ post }) => {
  const router = useRouter();
  console.log("router.query :", router.query, post);
  // const { postId } = router.query;

  return (
    <div className="post">
      <div className="post__title"></div>
      <div className="post__body"></div>
      <div className="post__comments"></div>
      <div className="post__edit"></div>
    </div>
  );
};

const mapStateToProps = ({ retrievePostReducer }) => ({
  post: retrievePostReducer.post,
});
const mapDispatchToProps = retrievePostActions;

export default connect(mapStateToProps, mapDispatchToProps)(Posts);
